Inspeccionan avances de la segunda fase del Plan Metro ¡Se Mueve Contigo! en estación La Paz

(MPPT. Prensa CAMETRO 06/05/2024).- La Vicepresidenta Ejecutiva de la República, Delcy Rodríguez, realizó una inspección por el Complejo MetroBús Patio La Paz , junto al ministro de Transporte y presidente del Metro de Caracas, Ramón Celestino Velásquez Araguayán, con el propósito de verificar la rehabilitación integral realizada al Centro de Atención Médica, ejecutado a través del Plan Metro ¡Se Mueve Contigo!

Durante el recorrido Rodríguez destacó: "Ante el bloqueo imperial criminal que atentó contra el pueblo venezolano y los servicios públicos, aquí está la respuesta que da Venezuela entera, con esfuerzo propio para lograr objetivos estratégicos en la atención a los venezolanos y venezolanas".

Por su parte el ministro Velásquez Araguayán, agradeció el compromiso de Rodríguez como madrina del sistema de transporte, en el marco del Plan Metro ¡Se Mueve Contigo!, el cual es ejecutado en esta segunda fase por el personal calificado de la compañía. “Es la masa trabajadora del Metro que lleva adelante y da el todo por el todo, para un 100 % de recuperación y brindar un servicio de calidad, eficiente y económico”.

El Plan Metro ¡Se Mueve Contigo! continúa ejecutando las distintas labores de rehabilitación instruidas por el presidente de la República, Nicolás Maduro, fortaleciendo de manera integral el principal sistema de transporte de la ciudad capital.

