Venezuela Activa Militar! Un día lleno de deporte, unión y valores en el Parque Arístides Rojas

Desde las rehabilitadas Canchas de Usos Múltiples del Parque Arístides Rojas, ayer se llevó a cabo la jornada "Venezuela Activa Militar", una iniciativa conjunta entre el Gobierno Bolivariano y la Guardia del Pueblo, que busca promover la actividad física, la recreación y el sano esparcimiento entre la comunidad.

Donde pudieron disfrutar de diversas actividades deportivas, como fútbol, baloncesto, voleibol y bailoterapias, creando un ambiente festivo y familiar..

"Venezuela Activa Militar" es una muestra del compromiso del Gobierno Bolivariano con el bienestar integral del pueblo. A través de estas iniciativas, se busca fortalecer la unión Cívico-militar, promover valores como la disciplina y el respeto, y fomentar un estilo de vida saludable en la población.

¡Felicidades a todos los que participaron en esta gran jornada! Sigamos juntos construyendo una Venezuela más activa, saludable y unida.

